import "./App.css";
import "./index.css";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import { AboutUs, HIW, Navbar, Pricing, FAQs } from "./components";
import { Header, Footer } from "./containers";

function App() {
  return (
    <div className="App">
      <Router>
        <div className="wrap_main-content">
          <Routes>
            <Navbar />
            <Route path="/" exact Component={Header}></Route>
            <Route path="/" exact Component={AboutUs}></Route>
            <Route path="/" exact Component={HIW}></Route>
            <Route path="/" exact Component={Pricing}></Route>
            <Route path="/" exact Component={FAQs}></Route>
            <Footer />
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
